query GetVideoLesson($uniqueCode: String!, $subsectionUniqueCode: String!, $moduleUniqueCode: String!, $inVideoQuestionFilter: InVideoQuestionFilter, $inVideoQuestionOrder: [InVideoQuestionOrdering]) {
  videoLesson(
    filter: {uniqueCode: $uniqueCode, subsectionUniqueCode: $subsectionUniqueCode, moduleUniqueCode: $moduleUniqueCode}
  ) {
    id
    module {
      id
      uniqueCode
      title
      examBoardSubject {
        subject: subjectObject {
          qualification {
            uniqueCode
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    subsection {
      id
      name
      uniqueCode
      __typename
    }
    wistiaId
    uniqueCode
    title
    length
    duration
    extraContent
    skipRecapStartTime
    preVideoQuestions {
      __typename
      id
      quizContent {
        ...UnmarkedQuestion
        __typename
      }
    }
    inVideoQuizQuestions(
      filter: $inVideoQuestionFilter
      order: $inVideoQuestionOrder
    ) {
      __typename
      id
      triggerTime
      postQuestionResumeTime
      quizContent {
        __typename
        ...UnmarkedQuestion
      }
    }
    __typename
  }
}

fragment UnmarkedQuestion on QuizContent {
  __typename
  id
  stem
  quizDefinition {
    __typename
    questions {
      ...UnmarkedQuestionPart
      __typename
    }
  }
}

fragment UnmarkedQuestionPart on QuizQuestion {
  __typename
  ... on MultipleChoiceQuestion {
    question
    description
    image
    topImage
    options {
      text
      image
      __typename
    }
    __typename
  }
  ... on MultiMultipleChoiceQuestion {
    question
    description
    image
    topImage
    options {
      text
      image
      __typename
    }
    __typename
  }
  ... on TextQuestion {
    question
    description
    image
    topImage
    beforeText
    afterText
    __typename
  }
  ... on NumericalQuestion {
    question
    description
    image
    topImage
    beforeText
    afterText
    __typename
  }
  ... on MathsQuestion {
    question
    description
    image
    topImage
    __typename
  }
  ... on MultipleInputQuestion {
    questionSegments {
      type: __typename
      ... on MultipleInputQuestionText {
        text
        __typename
      }
      ... on MultipleInputQuestionBlank {
        fieldIndex
        __typename
      }
    }
    description
    image
    topImage
    __typename
  }
  ... on ChemistryQuestion {
    question
    description
    image
    topImage
    __typename
  }
  ... on DropdownQuestion {
    question
    description
    image
    topImage
    dropdownOptions
    __typename
  }
  ... on DrawQuestion {
    question
    description
    image
    topImage
    drawOn
    __typename
  }
  ... on OpenEndedQuestion {
    question
    description
    image
    topImage
    __typename
  }
}
